### 389 Find the Difference

class Solution(object):
	def findTheDifference(self, s, t):
		dic = {}
		htable = "abcdefghijklmnopqrstuvwxyz"
		for i in htable:
			dic[i] = 0
		for i in t:
			dic[i] +=1
		for i in s:
			dic[i] -=1
		v = dic.values()
		k = dic.keys()
		return k[v.index(1)]

s = Solution()
